import React from "react";
import UndoPaste from "./HomeNavBar/undo_paste";
import Font_Size from "./HomeNavBar/Font_Size";
import Styling from "./HomeNavBar/Styling";
import TextFormatting from "./HomeNavBar/Text_formatting";
import Styles from "./HomeNavBar/Styles";
import Tags from "./HomeNavBar/Tags";
import Spellcheck from "./HomeNavBar/spellCheck";
import Dictate from "./HomeNavBar/Dictate";
import Feed from "./HomeNavBar/Feed";

function HomeBar() {
    return <div className="bottomNav">
        <UndoPaste />
        <Font_Size />
        <Styling />
        <TextFormatting />
        <Styles />
        <Tags />
        <Spellcheck />
        <Dictate />
        <Feed />
    </div>
}

export default HomeBar;
